import React from 'react';
import Button from '@material-ui/core/Button';
import DeleteIcon from '@material-ui/icons/Delete';

const Mynotes = () => {
    return (
        <>
            <div>
                <h1>Notes</h1>
                <Button>
                    <DeleteIcon />
                </Button>

            </div>
        </>
    );
}

export default Mynotes;
